const promise = loadStripe(
  "pk_test_51Mv3phJFksDXPTtIwcBdAkVxDFyLrUUdROqapeBZj2PVOXKWvxKygRFgUrlKTxgV5p1Eqy9Kh3nKYPclIcLq6lXL00PEnYa1He"
);

function App() {
  // make it empty array we have to add diffrent item
